It's kind of weird to think that in a few days I will be back in the classroom with students for the first time since March! That's wild üò≥üò≥üò≥ It's been a long time and emotions are still everywhere right now. 

It's also time for the bittersweet final goodbye to summer. But man, did we soak this summer up! Different than summers before but yet, still the same. The days were filled with sun and freedom and we breathed that in. So long to the days that felt like weekends . . . time to actually remember what day it is! This has already proved to be a challenge for me as I thought it was Tuesday for like three days straight ü§¶‚Äç‚ôÄÔ∏èü§¶‚Äç‚ôÄÔ∏èü§¶‚Äç‚ôÄÔ∏è

That routine is starting to set back in but I'm already missing my early morning barre classes followed by my morning coffees on my deck, and feeling that sun while I drank slowly. My to-go cup just isn't the same aesthetic and there's a little more urgency with every sip. 

But I was able to find clarity in these summer months. I rediscovered what's important and things I truly love and appreciate. I'm hoping that clarity continues with me, even in times of uncertainty. 

As we head into this long weekend, let's take some time to reflect, maybe even throw the summer a thank you. This ending is always bittersweet, I never want to say goodbye to my summer but I look forward to what the next season has in store. 

So enjoy this weekend. Let it be the sweetest ending and the perfect beginning.

